%%%%% Ordinary differential Equations:
function [time_arr,x_arr]=ode(xdot,d_t,x_0)
    
    time_arr = zeros(1, N);
    x_arr = zeros(10, N);
    x_all=x_0;
    
        for j=1:1:N
            x_arr(:,j)  =   x_all;
            xdot_out    =   xdot(j, x_all);
            x_all       =   xdot_out*d_t+x_all;
        end

end

